import React from 'react';
import {  Button, Row, Col } from 'antd';


const FollowersCard = (props) => {


    return (
      <div>
        <section>

            <Row type="flex" justify="space-around">
                <Col span={6}>
                <img
                width={110}
                height={120}
                src={props.img} roundedCircle/> 

                <a href={props.html_url}>
                    <h4>{props.login}</h4>
                </a>
                </Col>

            </Row>

        </section>
      </div>
    );
}

export default FollowersCard;
